import React, { useState, useEffect } from 'react';
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';
import { MapPin, AlertTriangle, Shield, LogOut, Plus, Filter, Clock, TrendingUp, Mail, User, Phone, MapPinned, Download, X } from 'lucide-react';
import { authAPI, reportsAPI } from './services/api';
import LoginScreen from './components/LoginScreen';
import ReportMap from './components/ReportMap';
import AdminMap from './components/AdminMap';
import UserMap from './components/UserMap';
import LegalModal from './components/LegalModal';


const App = () => {
  const [user, setUser] = useState(null);
  const [reports, setReports] = useState([]);
  const [showRegister, setShowRegister] = useState(false);
  const [showVerification, setShowVerification] = useState(false);
  const [pendingEmail, setPendingEmail] = useState('');
  const [isAddingReport, setIsAddingReport] = useState(false);
  const [selectedImage, setSelectedImage] = useState(null);
  const [showImageModal, setShowImageModal] = useState(false);
  const [showLegalModal, setShowLegalModal] = useState(false);
  const [showUserMap, setShowUserMap] = useState(false);


  const [newReport, setNewReport] = useState({
    type: 'robo',
    description: '',
    points: [],
    exactLocation: null,
    date: new Date().toISOString().split('T')[0],
    time: new Date().toTimeString().split(' ')[0].substring(0, 5),
    testigos: '',
    detallesAdicionales: '',
    objetosRobados: '',
    montoAproximado: '',
    imagenes: []
  });
  const [filter, setFilter] = useState('all');
  const [mapClickMode, setMapClickMode] = useState(null);


  useEffect(() => {
    const checkSession = async () => {
      const token = localStorage.getItem('token');
      if (token) {
        try {
          const response = await authAPI.verify(token);
          if (response.success) {
            setUser(response.user);
          } else {
            localStorage.removeItem('token');
          }
        } catch (error) {
          console.error('Session verification failed:', error);
          localStorage.removeItem('token');
        }
      }
    };
    checkSession();
  }, []);

  useEffect(() => {
    if (user && !user.isAdmin) {
      loadUserReports();
    } else if (user && user.isAdmin) {
      loadAllReports();
    }
  }, [user]);

  const loadUserReports = async () => {
    try {
      const response = await reportsAPI.getMyReports();
      setReports(response.reports);
    } catch (error) {
      console.error('Error fetching all reports:', error);
    }
  };

  const loadAllReports = async () => {
    try {
      console.log(' Cargando reportes del admin...');
      const response = await reportsAPI.getAllReports();
      console.log('Reportes cargados:', response.reports);
      setReports(response.reports);
    } catch (error) {
      console.error('Error cargando reportes:', error);
      alert('Error al cargar reportes: ' + error.message);
    }
  };

  const handleLogin = (userData) => {
    setUser(userData);
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    setUser(null);
    setReports([]);
  };


  const handleAddPoint = (point) => {
    setNewReport(prev => {
      const newPoints = [...prev.points, point];
      if (newPoints.length >= 3) {
        setMapClickMode(null);
      }
      return { ...prev, points: newPoints };
    });
  };

  const handleSetExactLocation = (location) => {

    setNewReport(prev => ({
      ...prev,
      exactLocation: location
    }));
    setMapClickMode(null);
  };

  const handleImageUpload = (e) => {
    const files = Array.from(e.target.files);

    if (files.length + newReport.imagenes.length > 5) {
      alert('Máximo 5 imágenes permitidas');
      return;
    }

    files.forEach(file => {
      if (file.size > 5 * 1024 * 1024) {
        alert('Cada imagen debe pesar menos de 5MB');
        return;
      }

      const reader = new FileReader();
      reader.onload = (event) => {
        setNewReport(prev => ({
          ...prev,
          imagenes: [...prev.imagenes, {
            id: Date.now() + Math.random(),
            data: event.target.result,
            name: file.name,
            size: file.size
          }]
        }));
      };
      reader.readAsDataURL(file);
    });
  };

  const removeImage = (imageId) => {
    setNewReport(prev => ({
      ...prev,
      imagenes: prev.imagenes.filter(img => img.id !== imageId)
    }));
  };


  const confirmSubmitReport = async () => {
    const dataToSend = {
      ...newReport,
      testigos: newReport.testigos || null,
      detallesAdicionales: newReport.detallesAdicionales || null,
      objetosRobados: newReport.objetosRobados || null,
      montoAproximado: newReport.montoAproximado || null,
      points: newReport.points,
      exactLocation: newReport.exactLocation,
      imagenes: newReport.imagenes.map(img => img.data)
    };

    try {
      await reportsAPI.create(dataToSend);

      setNewReport({
        type: 'robo',
        description: '',
        points: [],
        exactLocation: null,
        date: new Date().toISOString().split('T')[0],
        time: new Date().toTimeString().split(' ')[0].substring(0, 5),
        testigos: '',
        detallesAdicionales: '',
        objetosRobados: '',
        montoAproximado: '',
        imagenes: []
      });
      setIsAddingReport(false);
      setMapClickMode(null);
      setShowLegalModal(false);
      alert('Reporte enviado exitosamente');
      loadUserReports();
    } catch (error) {
      console.error('Error al enviar reporte:', error);
      alert('Error al enviar reporte. Revisa la consola: ' + error.message);
    }
  };

  const submitReport = async () => {
    if (!newReport.description) {
      alert('Por favor, completa la descripción del incidente.');
      return;
    }
    if (newReport.points.length === 0 && !newReport.exactLocation) {
      alert('Por favor, marca al menos un punto o la ubicación exacta en el mapa.');
      return;
    }
    setShowLegalModal(true);
  };


  const calculateRiskZones = () => {
    const heatmap = {};
    const precision = 3;

    reports.forEach(report => {
      // Intenta parsear los datos JSON si son strings (vienen así del backend)
      const points = (typeof report.points === 'string' && report.points) ? JSON.parse(report.points) : report.points || [];


      if (Array.isArray(points)) {
        points.forEach(point => {
          if (point && point.lat !== undefined && point.lng !== undefined) {
            const latKey = point.lat.toFixed(precision);
            const lngKey = point.lng.toFixed(precision);
            const key = `${latKey},${lngKey}`;
            heatmap[key] = (heatmap[key] || 0) + 1;
          }
        });
      }
    });

    return Object.keys(heatmap).map(key => ({ intensity: heatmap[key] }));
  };


  const getTypeColor = (type) => {
    const colors = {
      robo: '#ef4444',
      asalto: '#f97316',
      acoso: '#8b5cf6',
      vandalismo: '#eab308'
    };
    return colors[type] || '#6b7280';
  };


  const filteredReports = filter === 'all'
    ? reports
    : reports.filter(r => r.type === filter);

  const stats = {
    total: reports.length,
    thisWeek: reports.filter(r => {
      const reportDate = new Date(r.created_at);
      const weekAgo = new Date();
      weekAgo.setDate(weekAgo.getDate() - 7);
      return reportDate > weekAgo;
    }).length,
    byType: reports.reduce((acc, r) => {
      acc[r.type] = (acc[r.type] || 0) + 1;
      return acc;
    }, {})
  };

  const ImageModal = () => {
    if (!showImageModal || !selectedImage) return null;

    return (
      <div
        className="fixed inset-0 bg-black bg-opacity-75 z-50 flex items-center justify-center p-4"
        onClick={() => setShowImageModal(false)}
      >
        <div className="relative max-w-full max-h-screen">
          <button
            onClick={() => setShowImageModal(false)}
            className="absolute -top-10 right-0 text-white hover:text-gray-300 text-2xl font-bold"
          >
            ✕
          </button>
          <img
            src={selectedImage}
            alt="Evidencia ampliada"
            className="max-w-full max-h-screen object-contain rounded-lg"
            onClick={(e) => e.stopPropagation()}
          />
          <div className="absolute bottom-4 right-4 flex gap-2">
            <button
              onClick={(e) => {
                e.stopPropagation();
                const link = document.createElement('a');
                link.href = selectedImage;
                link.download = `evidencia_${Date.now()}.jpg`;
                link.click();
              }}
              className="px-4 py-2 bg-indigo-600 text-white rounded-lg hover:bg-indigo-700"
            >
              Descargar
            </button>
          </div>
        </div>
      </div>
    );
  };

  if (!user) {
    return (
      <LoginScreen
        onLogin={handleLogin}
        onShowRegister={() => setShowRegister(true)}
        showRegister={showRegister}
        setShowRegister={setShowRegister}
        showVerification={showVerification}
        setShowVerification={setShowVerification}
        pendingEmail={pendingEmail}
        setPendingEmail={setPendingEmail}
      />
    );
  }

  if (user.isAdmin) {
    return (
      <AdminDashboard
        reports={filteredReports}
        allReports={reports}
        filter={filter}
        setFilter={setFilter}
        stats={stats}
        calculateRiskZones={calculateRiskZones}
        getTypeColor={getTypeColor}
        onLogout={handleLogout}
        setSelectedImage={setSelectedImage}
        setShowImageModal={setShowImageModal}
        onReject={handleRejectReport}
      />
    );
  }


  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-100 p-4">
      <div className="max-w-6xl mx-auto">
        {/* ... (Header) ... */}
        <header className="bg-white rounded-lg shadow-lg p-6 mb-6">
          <div className="flex justify-between items-center">
            <div className="flex items-center gap-3">
              <Shield className="w-8 h-8 text-indigo-600" />
              <div>
                <h1 className="text-2xl font-bold text-gray-800">Denuncias Digitales</h1>
                <p className="text-sm text-gray-600">
                  {user.userData.nombres} {user.userData.apellidoPaterno} - DNI: {user.userData.dni}
                  <span className="ml-2 px-2 py-0.5 bg-yellow-100 text-yellow-800 rounded-full text-xs font-medium">
                    Reputación: {user.userData.reputation || 0}
                  </span>
                </p>

              </div>
            </div>
            <button
              onClick={handleLogout}
              className="flex items-center gap-2 px-4 py-2 bg-gray-200 rounded-lg hover:bg-gray-300"
            >
              <LogOut className="w-4 h-4" />
              Salir
            </button>
          </div>
        </header>

        {
          showUserMap ? (
            <UserMap onBack={() => setShowUserMap(false)} />
          ) : !isAddingReport ? (

            <div className="bg-white rounded-lg shadow-lg p-6">
              <div className="flex justify-between items-center mb-6">
                <h2 className="text-xl font-bold text-gray-800">Mis Reportes</h2>
                <div className="flex gap-3">
                  <button
                    onClick={() => setShowUserMap(true)}
                    className="flex items-center gap-2 px-6 py-3 bg-red-600 text-white rounded-lg hover:bg-red-700 transition-colors"
                  >
                    <MapPinned className="w-5 h-5" />
                    Mapa de Riesgo
                  </button>
                  <button
                    onClick={() => setIsAddingReport(true)}
                    className="flex items-center gap-2 px-6 py-3 bg-indigo-600 text-white rounded-lg hover:bg-indigo-700"
                  >
                    <Plus className="w-5 h-5" />
                    Nueva Denuncia
                  </button>
                </div>
              </div>

              <div className="space-y-4">
                {reports.length === 0 ? (
                  <p className="text-center text-gray-500 py-8">No tienes denuncias registradas</p>
                ) : (
                  reports.map(report => (
                    <div key={report.id} className="border rounded-lg p-4 hover:shadow-md transition-shadow">
                      <div className="flex justify-between items-start mb-2">
                        <div className="flex items-center gap-2">
                          <AlertTriangle className="w-5 h-5" style={{ color: getTypeColor(report.type) }} />
                          <span className="font-semibold capitalize">{report.type}</span>
                        </div>
                        <span className="text-sm text-gray-500">
                          {new Date(report.created_at).toLocaleDateString()} - {report.time}
                        </span>
                      </div>
                      <p className="text-gray-700 mb-2">{report.description}</p>
                      {report.objetos_robados && (
                        <p className="text-sm text-gray-600">Objetos: {report.objetos_robados}</p>
                      )}
                      {report.monto_aproximado && (
                        <p className="text-sm text-gray-600">Monto aprox: S/ {report.monto_aproximado}</p>
                      )}


                      {(() => {
                        try {
                          const imgs = report.imagenes && report.imagenes !== 'null' ? JSON.parse(report.imagenes) : [];
                          return imgs.length > 0 ? (
                            <div className="flex gap-2 mt-2 overflow-x-auto">
                              {imgs.map((img, idx) => (
                                <img
                                  key={idx}
                                  src={img}
                                  alt={`Evidencia ${idx + 1}`}
                                  className="w-32 h-32 object-cover rounded border cursor-pointer hover:scale-105 transition-transform"
                                  onClick={() => {
                                    setSelectedImage(img);
                                    setShowImageModal(true);
                                  }}
                                />
                              ))}
                            </div>
                          ) : null;
                        } catch (e) {
                          return null;
                        }
                      })()}

                    </div>
                  ))
                )}
              </div>
            </div>
          ) : (

            <div className="bg-white rounded-lg shadow-lg p-6">
              <h2 className="text-xl font-bold text-gray-800 mb-6">Nueva Denuncia Ciudadana</h2>

              <div className="space-y-6 mb-6">

                <div className="bg-blue-50 rounded-lg p-4">
                  <h3 className="font-semibold text-gray-800 mb-3 flex items-center gap-2">
                    <User className="w-5 h-5 text-indigo-600" />
                    Información del Denunciante
                  </h3>
                  <div className="grid grid-cols-1 md:grid-cols-2 gap-4 text-sm">
                    <div>
                      <p className="text-gray-600">Nombres Completos:</p>
                      <p className="font-medium">{user.userData.nombres} {user.userData.apellidoPaterno} {user.userData.apellidoMaterno}</p>
                    </div>
                    <div>
                      <p className="text-gray-600">DNI:</p>
                      <p className="font-medium">{user.userData.dni}</p>
                    </div>
                    <div>
                      <p className="text-gray-600">Teléfono:</p>
                      <p className="font-medium">{user.userData.telefono}</p>
                    </div>
                    <div>
                      <p className="text-gray-600">Correo:</p>
                      <p className="font-medium">{user.userData.email}</p>
                    </div>
                  </div>
                </div>

                <div>
                  <h3 className="font-semibold text-gray-800 mb-3 flex items-center gap-2">
                    <AlertTriangle className="w-5 h-5 text-red-600" />
                    Detalles del Incidente
                  </h3>
                  <div className="space-y-4">

                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-2">
                        Tipo de Incidente <span className="text-red-500">*</span>
                      </label>
                      <select
                        value={newReport.type}
                        onChange={(e) => setNewReport({ ...newReport, type: e.target.value })}
                        className="w-full px-4 py-2 border rounded-lg focus:ring-2 focus:ring-indigo-500"
                      >
                        <option value="robo">Robo</option>
                        <option value="asalto">Asalto</option>
                        <option value="acoso">Acoso</option>
                        <option value="vandalismo">Vandalismo</option>
                      </select>
                    </div>

                    <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                      <div>
                        <label className="block text-sm font-medium text-gray-700 mb-2">
                          Fecha del Incidente <span className="text-red-500">*</span>
                        </label>
                        <input
                          type="date"
                          value={newReport.date}
                          onChange={(e) => setNewReport({ ...newReport, date: e.target.value })}
                          className="w-full px-4 py-2 border rounded-lg focus:ring-2 focus:ring-indigo-500"
                        />
                      </div>
                      <div>
                        <label className="block text-sm font-medium text-gray-700 mb-2">
                          Hora Aproximada <span className="text-red-500">*</span>
                        </label>
                        <input
                          type="time"
                          value={newReport.time}
                          onChange={(e) => setNewReport({ ...newReport, time: e.target.value })}
                          className="w-full px-4 py-2 border rounded-lg focus:ring-2 focus:ring-indigo-500"
                        />
                      </div>
                    </div>

                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-2">
                        Descripción Detallada del Incidente <span className="text-red-500">*</span>
                      </label>
                      <textarea
                        value={newReport.description}
                        onChange={(e) => setNewReport({ ...newReport, description: e.target.value })}
                        className="w-full px-4 py-2 border rounded-lg focus:ring-2 focus:ring-indigo-500"
                        rows="4"
                        placeholder="Describa con detalle lo sucedido: cómo ocurrió, características de los responsables, vehículos involucrados, etc."
                      />
                    </div>

                    {newReport.type === 'robo' && (
                      <>
                        <div>
                          <label className="block text-sm font-medium text-gray-700 mb-2">
                            Objetos Robados
                          </label>
                          <input
                            type="text"
                            value={newReport.objetosRobados}
                            onChange={(e) => setNewReport({ ...newReport, objetosRobados: e.target.value })}
                            className="w-full px-4 py-2 border rounded-lg focus:ring-2 focus:ring-indigo-500"
                            placeholder="Ej: Celular Samsung, billetera, documentos"
                          />
                        </div>
                        <div>
                          <label className="block text-sm font-medium text-gray-700 mb-2">
                            Monto Aproximado (S/)
                          </label>
                          <input
                            type="number"
                            value={newReport.montoAproximado}
                            onChange={(e) => setNewReport({ ...newReport, montoAproximado: e.target.value })}
                            className="w-full px-4 py-2 border rounded-lg focus:ring-2 focus:ring-indigo-500"
                            placeholder="Valor aproximado de lo robado"
                          />
                        </div>
                      </>
                    )}

                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-2">
                        Testigos (Nombres y contactos)
                      </label>
                      <textarea
                        value={newReport.testigos}
                        onChange={(e) => setNewReport({ ...newReport, testigos: e.target.value })}
                        className="w-full px-4 py-2 border rounded-lg focus:ring-2 focus:ring-indigo-500"
                        rows="2"
                        placeholder="Nombres completos y teléfonos de testigos si los hay"
                      />
                    </div>

                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-2">
                        Detalles Adicionales
                      </label>
                      <textarea
                        value={newReport.detallesAdicionales}
                        onChange={(e) => setNewReport({ ...newReport, detallesAdicionales: e.target.value })}
                        className="w-full px-4 py-2 border rounded-lg focus:ring-2 focus:ring-indigo-500"
                        rows="2"
                        placeholder="Cualquier información adicional relevante"
                      />
                    </div>

                    <div>
                      <label className="block text-sm font-medium text-gray-700 mb-2">
                        Evidencia Fotográfica (Opcional)
                      </label>
                      <p className="text-xs text-gray-500 mb-3">
                        Puede adjuntar hasta 5 imágenes como evidencia (máx. 5MB cada una)
                      </p>

                      <input
                        type="file"
                        accept="image/*"
                        multiple
                        onChange={handleImageUpload}
                        className="hidden"
                        id="image-upload"
                      />

                      <label
                        htmlFor="image-upload"
                        className="cursor-pointer inline-flex items-center gap-2 px-4 py-2 bg-gray-100 border-2 border-dashed border-gray-300 rounded-lg hover:bg-gray-200 transition-colors"
                      >
                        <svg className="w-5 h-5 text-gray-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 4v16m8-8H4" />
                        </svg>
                        Seleccionar Imágenes
                      </label>

                      {newReport.imagenes.length > 0 && (
                        <div className="grid grid-cols-2 md:grid-cols-3 gap-3 mt-4">
                          {newReport.imagenes.map((imagen) => (
                            <div key={imagen.id} className="relative group">
                              <img
                                src={imagen.data}
                                alt={imagen.name}
                                className="w-full h-56 object-cover rounded-lg border-2 border-gray-200"
                              />
                              <button
                                type="button"
                                onClick={() => removeImage(imagen.id)}
                                className="absolute top-2 right-2 bg-red-500 text-white rounded-full p-1 opacity-0 group-hover:opacity-100 transition-opacity"
                              >
                                <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
                                </svg>
                              </button>
                              <p className="text-xs text-gray-500 mt-1 truncate">{imagen.name}</p>
                              <p className="text-xs text-gray-400">{(imagen.size / 1024).toFixed(1)} KB</p>
                            </div>
                          ))}
                        </div>
                      )}
                    </div>
                  </div>
                </div>

                <div>
                  <h3 className="font-semibold text-gray-800 mb-3 flex items-center gap-2">
                    <MapPinned className="w-5 h-5 text-green-600" />
                    Ubicación del Incidente <span className="text-red-500">*</span>
                  </h3>

                  <div className="space-y-3 mb-4">
                    <button
                      onClick={() => setMapClickMode('points')}
                      disabled={newReport.points.length >= 3}
                      className={`w-full px-4 py-3 rounded-lg border-2 transition-colors ${mapClickMode === 'points'
                        ? 'bg-indigo-100 border-indigo-600'
                        : 'border-gray-300 hover:border-indigo-400'
                        } ${newReport.points.length >= 3 ? 'opacity-50 cursor-not-allowed' : ''}`}
                    >
                      Marcar Área de Riesgo ({newReport.points.length}/3 puntos) - Radio ~50m
                    </button>
                    <button
                      onClick={() => setMapClickMode('exact')}
                      disabled={!!newReport.exactLocation}
                      className={`w-full px-4 py-3 rounded-lg border-2 transition-colors ${mapClickMode === 'exact'
                        ? 'bg-green-100 border-green-600'
                        : 'border-gray-300 hover:border-green-400'
                        } ${newReport.exactLocation ? 'opacity-50 cursor-not-allowed' : ''}`}
                    >
                      {newReport.exactLocation ? 'Ubicación Exacta Marcada ' : 'Marcar Ubicación Exacta (Opcional)'}
                    </button>
                  </div>

                  <ReportMap
                    points={newReport.points}
                    exactLocation={newReport.exactLocation}
                    onAddPoint={handleAddPoint}
                    onSetExactLocation={handleSetExactLocation}
                    mode={mapClickMode}
                  />
                </div>
              </div>

              <div className="flex flex-col md:flex-row gap-4 mt-6">
                <button
                  onClick={() => {
                    setIsAddingReport(false);
                    setNewReport({
                      type: 'robo',
                      description: '',
                      points: [],
                      exactLocation: null,
                      date: new Date().toISOString().split('T')[0],
                      time: new Date().toTimeString().split(' ')[0].substring(0, 5),
                      testigos: '',
                      detallesAdicionales: '',
                      objetosRobados: '',
                      montoAproximado: '',
                      imagenes: []
                    });
                  }}
                  className="flex-1 px-6 py-3 bg-gray-200 rounded-lg hover:bg-gray-300"
                >
                  Cancelar
                </button>
                <button
                  onClick={submitReport}
                  className="flex-1 px-6 py-3 bg-indigo-600 text-white rounded-lg hover:bg-indigo-700"
                >
                  Enviar Denuncia
                </button>
              </div>
            </div>
          )
        }
      </div >
      <LegalModal
        isOpen={showLegalModal}
        onClose={() => setShowLegalModal(false)}
        onConfirm={confirmSubmitReport}
      />
      <ImageModal />
    </div >
  );
};




const AdminDashboard = ({ reports, allReports, filter, setFilter, stats, calculateRiskZones, getTypeColor, onLogout, setSelectedImage, setShowImageModal, onReject }) => {
  const riskZones = calculateRiskZones();
  const maxIntensity = Math.max(...riskZones.map(z => z.intensity), 1);
  const [selectedReport, setSelectedReport] = useState(null);
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);


  const LOGO_BASE64 = 'data:image/png;base64,'; // User needs to replace this with their actual base64 string

  const generatePDF = (report) => {
    const doc = new jsPDF();
    const pageWidth = doc.internal.pageSize.getWidth();

    // --- Header ---
    doc.setFillColor(41, 128, 185);
    doc.rect(0, 0, pageWidth, 25, 'F');
    doc.setFontSize(20);
    doc.setTextColor(255, 255, 255);
    doc.text("Denuncia Ciudadana", 14, 17);
    if (LOGO_BASE64) {
      doc.addImage(LOGO_BASE64, pageWidth - 50, 2.5, 40, 0);
    }


    doc.setFontSize(16);//Denunciante datos
    doc.setTextColor(52, 73, 94);
    doc.text("1. Datos del Denunciante", 14, 40);

    const denuncianteData = [
      ["Nombres Completos:", `${report.nombres} ${report.apellido_paterno}`],
      ["DNI:", report.dni],
      ["Teléfono:", report.telefono || "No especificado"],
    ];

    autoTable(doc, {
      body: denuncianteData,
      startY: 45,
      theme: 'plain',
      styles: {
        font: 'helvetica',
        fontSize: 11,
        cellPadding: 2,
      },
      columnStyles: {
        0: { fontStyle: 'bold', cellWidth: 40 },
        1: { cellWidth: 'auto' },
      }
    });


    let finalY = doc.lastAutoTable.finalY + 15;//detalles del incidente
    doc.setFontSize(16);
    doc.text("2. Detalles del Incidente", 14, finalY);

    const incidenteData = [
      ["Tipo de Incidente:", report.type],
      ["Fecha y Hora:", new Date(report.created_at).toLocaleString()],
      ["Descripción:", report.description],
      ["Objetos Robados:", report.objetos_robados || "N/A"],
      ["Monto Aproximado:", report.monto_aproximado ? `S/ ${report.monto_aproximado}` : "N/A"],
      ["Testigos:", report.testigos || "N/A"],
      ["Detalles Adicionales:", report.detalles_adicionales || "N/A"],
    ];

    autoTable(doc, {
      body: incidenteData,
      startY: finalY + 5,
      theme: 'plain',
      styles: {
        font: 'helvetica',
        fontSize: 11,
        cellPadding: 2,
      },
      columnStyles: {
        0: { fontStyle: 'bold', cellWidth: 40 },
        1: { cellWidth: 'auto' },
      },
      didParseCell: (data) => {
        if (data.column.index === 1) {
          data.cell.styles.halign = 'left';
        }
      }
    });


    try { //imagenes
      const imgs = report.imagenes && report.imagenes !== 'null' ? JSON.parse(report.imagenes) : [];
      if (imgs.length > 0) {
        doc.addPage();
        doc.setFontSize(16);
        doc.text("3. Evidencia Fotográfica", 14, 20);

        let y = 30;
        const imgWidth = 80;
        const imgHeight = 60;
        const pageHeight = doc.internal.pageSize.height;
        const margin = 10;

        imgs.forEach((imgData) => {
          if (y + imgHeight + margin > pageHeight) {
            doc.addPage();
            y = 20; // Reset Y for new page
          }
          doc.addImage(imgData, 14, y, imgWidth, imgHeight);
          y += imgHeight + margin;
        });
      }
    } catch (e) {
      console.error("Error al procesar imágenes para el PDF:", e);
    }


    const pageCount = doc.internal.getNumberOfPages();
    for (let i = 1; i <= pageCount; i++) {
      doc.setPage(i);
      doc.setFontSize(9);
      doc.setTextColor(150);
      doc.text(
        `Página ${i} de ${pageCount}`,
        pageWidth / 2,
        doc.internal.pageSize.height - 10,
        { align: 'center' }
      );
      doc.text(
        `Generado el: ${new Date().toLocaleDateString()}`,
        14,
        doc.internal.pageSize.height - 10
      );
    }

    doc.save(`denuncia-${report.id}.pdf`);
  };

  const filteredReports = filter === 'all'
    ? allReports
    : allReports.filter(r => r.type === filter);

  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-900 to-slate-800 p-4">
      <div className="max-w-7xl mx-auto">
        <header className="bg-gradient-to-r from-red-600 to-orange-600 rounded-lg shadow-lg p-6 mb-6">
          <div className="flex justify-between items-center">
            <div className="flex items-center gap-3">
              <AlertTriangle className="w-8 h-8 text-white" />
              <div>
                <h1 className="text-2xl font-bold text-white">Panel de Administración</h1>
                <p className="text-sm text-red-100">Monitoreo de Zonas de Riesgo</p>
              </div>
            </div>
            <button
              onClick={onLogout}
              className="flex items-center gap-2 px-4 py-2 bg-white/20 text-white rounded-lg hover:bg-white/30"
            >
              <LogOut className="w-4 h-4" />
              Salir
            </button>
          </div>
        </header>
        <div className="grid grid-cols-1 md:grid-cols-4 gap-4 mb-6">
          <div className="bg-white rounded-lg shadow-lg p-6">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-sm text-gray-600">Total Reportes</p>
                <p className="text-3xl font-bold text-gray-800">{stats.total}</p>
              </div>
              <Shield className="w-12 h-12 text-indigo-600 opacity-20" />
            </div>
          </div>

          <div className="bg-white rounded-lg shadow-lg p-6">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-sm text-gray-600">Esta Semana</p>
                <p className="text-3xl font-bold text-orange-600">{stats.thisWeek}</p>
              </div>
              <Clock className="w-12 h-12 text-orange-600 opacity-20" />
            </div>
          </div>

          <div className="bg-white rounded-lg shadow-lg p-6">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-sm text-gray-600">Zonas de Riesgo</p>
                <p className="text-3xl font-bold text-red-600">{riskZones.length}</p>
              </div>
              <MapPin className="w-12 h-12 text-red-600 opacity-20" />
            </div>
          </div>

          <div className="bg-white rounded-lg shadow-lg p-6">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-sm text-gray-600">Tendencia</p>
                <p className="text-3xl font-bold text-green-600">
                  {stats.thisWeek > 0 ? '+' : ''}{stats.thisWeek}
                </p>
              </div>
              <TrendingUp className="w-12 h-12 text-green-600 opacity-20" />
            </div>
          </div>
        </div>


        <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
          <div className="lg:col-span-2 bg-white rounded-lg shadow-lg p-6">
            <div className="flex justify-between items-center mb-4">
              <h2 className="text-xl font-bold text-gray-800">Mapa de Zonas de Riesgo</h2>
              <div className="flex items-center gap-2">
                <Filter className="w-4 h-4 text-gray-600" />
                <select
                  value={filter}
                  onChange={(e) => setFilter(e.target.value)}
                  className="px-3 py-2 border rounded-lg text-sm"
                >
                  <option value="all">Todos</option>
                  <option value="robo">Robo</option>
                  <option value="asalto">Asalto</option>
                  <option value="acoso">Acoso</option>
                  <option value="vandalismo">Vandalismo</option>
                </select>
              </div>
            </div>


            <AdminMap
              reports={filteredReports}
              getTypeColor={getTypeColor}
              selectedReport={selectedReport}
            />


          </div>

          <div className="bg-white rounded-lg shadow-lg p-6">
            <h2 className="text-xl font-bold text-gray-800 mb-4">Reportes Recientes</h2>
            <div className="space-y-3 max-h-96 overflow-y-auto">
              {allReports.length === 0 ? (
                <p className="text-center text-gray-500 py-8">No hay reportes aún</p>
              ) : (
                allReports
                  .sort((a, b) => new Date(b.created_at) - new Date(a.created_at))
                  .map(report => (
                    <div
                      key={report.id}
                      className={`border rounded-lg p-3 hover:shadow-md transition-shadow cursor-pointer ${selectedReport?.id === report.id ? 'border-indigo-500 bg-indigo-50' : ''}`}
                      onClick={() => setSelectedReport(report)}
                    >
                      <div className="flex items-start justify-between mb-2">
                        <div className="flex items-center gap-2">
                          <div
                            className="w-3 h-3 rounded-full"
                            style={{ backgroundColor: getTypeColor(report.type) }}
                          />
                          <span className="font-semibold text-sm capitalize">{report.type}</span>
                        </div>
                        <div className="flex items-center gap-2">
                          <span className="text-xs text-gray-500">
                            {new Date(report.created_at).toLocaleDateString()}
                          </span>
                          <button
                            onClick={(e) => {
                              e.stopPropagation();
                              generatePDF(report);
                            }}
                            className="p-1 text-gray-500 hover:text-indigo-600"
                            title="Descargar PDF"
                          >
                            <Download className="w-4 h-4" />
                          </button>
                          {report.status !== 'rejected' && (
                            <button
                              onClick={(e) => {
                                e.stopPropagation();
                                onReject(report.id);
                              }}
                              className="p-1 text-gray-500 hover:text-red-600"
                              title="Rechazar Denuncia"
                            >
                              <X className="w-4 h-4" />
                            </button>
                          )}
                        </div>
                      </div>
                      <p className="text-sm text-gray-700 mb-1">{report.description}</p>
                      <p className="text-xs text-gray-500">Usuario: {report.nombres} {report.apellido_paterno}</p>
                      {report.dni && <p className="text-xs text-gray-500">DNI: {report.dni}</p>}


                      {(() => {
                        try {
                          const imgs = report.imagenes && report.imagenes !== 'null' ? JSON.parse(report.imagenes) : [];
                          return imgs.length > 0 ? (
                            <div className="mt-2">
                              <p className="text-xs text-gray-600 mb-1 font-medium">Evidencia ({imgs.length}):</p>
                              <div className="flex gap-1 overflow-x-auto">
                                {imgs.map((img, idx) => (
                                  <img
                                    key={idx}
                                    src={img}
                                    alt={`Evidencia ${idx + 1}`}
                                    className="w-16 h-16 object-cover rounded border cursor-pointer hover:scale-110 transition-transform"
                                    onClick={() => {
                                      setSelectedImage(img);
                                      setShowImageModal(true);
                                    }}
                                  />
                                ))}
                              </div>
                            </div>
                          ) : null;
                        } catch (e) {
                          return null;
                        }
                      })()}
                    </div>
                  ))
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};


export default App;